function getProject(){var editForm=document.getElementById("editProject");var spinMe=document.querySelectorAll("div .content")[0];var spinner=new Spinner({lines:13,length:20,width:10,radius:30,corners:1,rotate:0,direction:1,color:'#000',speed:1,trail:60,shadow:false,hwaccel:false,zIndex:2e9,top:'50%',left:'50%'}).spin(spinMe);spinMe.classList.toggle("blur");$.ajax({type:'POST',url:'lib/controllers/admin/getProject.php',data:{projectName:$(this).val()},dataType:'json',success:function(data){var githubURL=editForm.elements["githubURL"],category=editForm.elements["category"],brief=editForm.elements["brief"],description=editForm.elements["description"];githubURL.value=data.githubURL;category.value=data.category;brief.value=data.brief;description.value=data.description;githubURL.disabled=false;category.disabled=false;brief.disabled=false;description.disabled=false;spinMe.classList.toggle("blur");spinner.stop()},error:function(res){spinMe.classList.toggle("blur");spinner.stop();toastr.error(res.responseText,'Error!')}})};